import { useState } from "react";
import OutputList from "./OutputList";
import React from 'react';


const Prediction = () => {
  const [prediction, setPrediction] = useState([
    {title: "Model is getting Data", id: 1}
    //{ title: 'My new website', body: 'lorem ipsum...', author: 'mario', id: 1 },
    //{ title: 'Welcome party!', id: 2 },
    //{ title: 'Web dev top tips', id: 3 }
  ])

  const handlePrediction = () => {
    const newPrediction = {title: "Model is calculating", id: 2};
    setPrediction(prediction => [prediction, newPrediction]);

  }

  return (
    <div className="Preciction">
        <input type="text" name="Langitude" placeholder="Langitude" required></input>
        <br></br>
        <input type="text" name="Longitude" placeholder="Longitude" required></input>
        <br></br>
        <button type="submit" onclick="runMLModel()">RUN MODEL</button>
      <OutputList prediction={prediction} title="Prediction Steps" handlePrediction={handlePrediction} />
    </div>
  );
}

export default Prediction;
